import { Routes} from "@angular/router";
import { TelaPrincipalComponent } from "./tela-principal.component";
import { HomeComponent } from "../home/home.component";
import { TabelaOrdensComponent } from "src/app/components/tabela-ordens/tabela-ordens.component";

export const TelaPrincipalRotas: Routes = [
    {
        path: '',
        component: TelaPrincipalComponent,
        children: [
            {
                path: 'home',
                component: HomeComponent
            },
            {
                path: 'tabela',
                component: TabelaOrdensComponent
            }
        ]
    }
]
